import React from 'react';
import '../../App.css';

export default function Services() {
  return (
  <>
  <section className = "test">
  <h1 className='services'>SERVICES</h1>

  <p className ='normal-text text-center' >We offer delivery on site with the possibility of 
  installation with our sister company ( Capital Asphalt & Interlock)</p>

  </section>
  <p className ='normal-text' >We offer delivery on site with the possibility of 
  installation with our sister company ( Capital Asphalt & Interlock)</p>
  
<div className = "Installation">
  <img src="mulchinsta.jpg" alt="Mulch Picture"></img>
  
</div>
  
  </>
  );
}
